import React, { useEffect, useState } from 'react';

const RosterPaymentsPage = () => {
  const [roster, setRoster] = useState([]);

  useEffect(() => {
    fetch('/data/roster.json')
      .then(res => res.json())
      .then(data => setRoster(data))
      .catch(err => {
        console.error('Error loading roster:', err);
        setRoster([]);
      });
  }, []);

  return (
    <div style={{ padding: '20px', maxWidth: '700px', margin: '0 auto' }}>
      <h2 style={{ fontSize: '22px', fontWeight: 'bold', marginBottom: '16px' }}>
        Players Roster
      </h2>

      {roster.length === 0 ? (
        <p>No roster data available.</p>
      ) : (
        <table style={{ width: '100%', borderCollapse: 'collapse', border: '1px solid #ccc' }}>
          <thead>
            <tr style={{ backgroundColor: '#f0f0f0' }}>
              <th style={thStyle}>Game Name</th>
            </tr>
          </thead>
          <tbody>
            {roster.map((player, idx) => (
              <tr key={idx} style={{ backgroundColor: idx % 2 === 0 ? '#fff' : '#f9f9f9' }}>
                <td style={tdStyle}>{player.GameName || '-'}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

const thStyle = {
  padding: '10px',
  borderBottom: '2px solid #ccc',
  textAlign: 'left',
  fontWeight: 'bold'
};

const tdStyle = {
  padding: '8px',
  borderBottom: '1px solid #ddd'
};

export default RosterPaymentsPage;
